import React from "react";
import logo from "../../../images/sousmate.png";
import Image from "../../../ui/Image";

import "./ImgLogo.css";
export default function ImgLogo() {
  // return <img id="logo" src={logo} alt="Sousmate Logo" />;
  return (
    <Image id="logo" src="../../../images/sousmate.png" alt="Sousmate Logo" />
  );
}
